  /**
   * Function to handle to disclaimer behavior:
   *    - open when the 'disclaimer__open-button' is clicked
   *    - close when the 'disclaimer__close-button' is clicked
   */
  const disclaimerInit = () => {
    const disclaimerContainer = document.querySelector('.disclaimer__container');
    const disclaimerOpenButton = document.querySelector('.disclaimer__open-button');
    const disclaimerCloseButton = document.querySelector('.disclaimer__close-button');

    disclaimerOpenButton && disclaimerOpenButton.addEventListener('click', () => {
      disclaimerContainer.setAttribute('visible', '');
    });

    disclaimerCloseButton && disclaimerCloseButton.addEventListener('click', () => {
      disclaimerContainer.removeAttribute('visible');
    });
  };

  /**
   * Show and hide menu on smaller devices
   */
  const burger = () => {
    let burgerState = false;

    document.querySelector('.burger__button').addEventListener('click', () => {
      burgerState = !burgerState;
      burgerState ? openNav() : closeNav();
    });

    document.querySelector('.nav__scrim').addEventListener('click', () => {
      burgerState = false;
      closeNav();
    });

    let mql = window.matchMedia('(max-width: 921px)');
    mql.addEventListener( 'change', (event) => {
      if (!event.matches && burgerState) {
        burgerState = false;
        closeNav();
      }
    });

  };

  /**
   * Open nav add update all related element
   */
  const openNav = () => {
    document.querySelector('.burger__button').classList.add('burger__button--active');
    document.querySelector('.nav').classList.add('nav--active');
    document.querySelector('.nav__scrim').classList.add('nav__scrim--active');
  };

  /**
   * Close nav and update all related elements
   */
  const closeNav = () => {
    document.querySelector('.burger__button').classList.remove('burger__button--active');
    document.querySelector('.nav').classList.remove('nav--active');
    document.querySelector('.nav__scrim').classList.remove('nav__scrim--active');
  };

  const populateAmps = (ampsData) => {
    const ampsContainer = document.querySelector('.section--amps .gearlist');
    ampsContainer.innerHTML = '';
    ampsData.forEach(amp => {
      const ampItem = document.createElement('div');
      ampItem.classList.add('gearlist__item');

      const ampTitle = document.createElement('p');
      ampTitle.classList.add('gearlist__title');
      ampTitle.innerHTML = amp.headrushName;

      const ampBrand = document.createElement('p');
      ampBrand.classList.add('gearlist__brand');
      ampBrand.innerHTML = amp.brand;

      const ampModel = document.createElement('p');
      ampModel.classList.add('gearlist__model');
      ampModel.innerHTML = amp.model;

      const ampGenres = document.createElement('p');
      ampGenres.classList.add('gearlist__genres');
      ampGenres.innerHTML = amp.genre.join(', ');

      const ampPower = document.createElement('p');
      ampPower.classList.add('gearlist__power');
      ampPower.innerHTML = amp.power;

      const ampConfirmed = document.createElement('span');
      ampConfirmed.classList.add('gearlist__confirmed');
      amp.confirmed && ampConfirmed.setAttribute('confirmed', '');

      ampItem.appendChild(ampTitle);
      ampItem.appendChild(ampBrand);
      ampItem.appendChild(ampModel);
      ampItem.appendChild(ampGenres);
      ampItem.appendChild(ampPower);
      ampItem.appendChild(ampConfirmed);

      ampsContainer.appendChild(ampItem);
    });
  };

